import React from "react";
import { SidebarContainer, ExitButton, Slideshow, Title } from "./styles";

const Sidebar = ({ closeSidebar, project }) => {
  return (
    <SidebarContainer>
      <ExitButton onClick={closeSidebar}>Close</ExitButton>
      <Slideshow />
      <Title>{project.properties.title}</Title>
      {/* <Author></Author>
      <Description></Description> */}
    </SidebarContainer>
  );
};

export default Sidebar;
